import classes from "./mainBackground.module.css";
import classNames from "classnames";
import "animate.css";
function MainBackground(props) {
  return (
    <div
      className={classNames(
        classes.image,
        animate__animated,
        animate__fadeOutUp
      )}
    >
      {props.children}
    </div>
  );
}
export default MainBackground;
